import React from 'react';
import Video from './video3.mp4';

import classNamees from './backgroundVideo.module.css'

const BackgroundVideo = () => {
      return (
        <div classNameName={classNamees.Container}>

          <video autoPlay="autoplay" loop="loop" classNameName={classNamees.video}>
            <source src={Video} type="video/mp4"/>
          </video>

          <div classNameName={classNamees.Content}>
                <div classNameName={classNamees.SubContent} dark >
                    <h1>Julien GAKPE</h1>
                    <p> French Freelance - Developer Fullstack Junior react | node.js | MERN stack </p>
                    <p> Business and Financial Analyst</p>
                    <button type="button" classNameName="btn btn-outline-dark">View the course</button>
                </div>
          </div>

        </div>
      )
}

export default BackgroundVideo;
